const WhiteDownloadIcon = () => (
  <svg
    xmlns="http://www.w3.org/2000/svg"
    height="24"
    viewBox="0 0 24 24"
    width="24"
    focusable="false"
    style={{
      pointerEvents: "none",
      display: "inherit",
    }}
    aria-hidden="true">
    <path
      fill="#FFFFFF"
      d="M18 18v2H6v-2h12zm-.6-6.3L16 10.3l-3 2.9V4h-2v9.2l-3-2.9-1.4 1.4 5.4 5.4 5.4-5.4z"></path>
  </svg>
);
export default WhiteDownloadIcon;
